        strong: "MULTI-MEDIA ADVERTISING AND COMMUNICATION",
    },
    {
        id: '8',
        title: "STEP 08",
        para: "THE ME.ME SPECIALIZES IN",
        strong: "MULTI-MEDIA ADVERTISING AND COMMUNICATION",
    },
];
 
const worksIcon = () => {
    return(
        <ul>
            <li><Icofont icon="handshake-deal" /></li>
            <li><Icofont icon="rocket" /></li>
            <li><Icofont icon="responsive" /></li>
            <li><Icofont icon="code" /></li>
            <li><Icofont icon="ruler-pencil-alt-2" /></li>
            <li><Icofont icon="light-bulb" /></li>
            <li><Icofont icon="data" /></li>
            <li><Icofont icon="ui-copy" /></li>
        </ul>
    )
}


export {WorkList, worksIcon};
